import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import Users from "./audiImgs/cars.json";



export class Audi extends Component {



    // componentDidMount() {
    //     fetch('audiImgs/cars.json')
    //         .then(function(resp){
    //             return resp.json();
    //         })
    //         .then(function(data){
    //             console.log(data);
    //         })
    // }

    render() {

        return (
            <div className="container mb-3">
                <h1 className="mb-5 pb-5">Latest Added Cars :</h1>
                {Users.map(user => (
                    <Link to={user.Link} className="row cars-sel">
                        <img src={user.img} alt={user.name} className="col-lg-3" width="100%" />
                        <div className="col-lg-9">
                            <h3>{user.name}</h3>
                            <p>{user.price}</p>
                            <p>{user.Reviews}</p>
                        </div>
                    </Link>
                ))}
            </div>
        )
    }
}

export default Audi
